00255         public virtual SerializationFlags OnNetSerialize(int frameId, byte[] buffer, ref int bitposition, SerializationFlags writeFlags)
00256         {
00257 
00258             //if (!IsMine)
00259             //{
00260             //    /// attached bool
00261             //    buffer.WriteBool(false, ref bitposition);
00262             //    return SerializationFlags.None;
00263             //}
00264 
00265             Frame frame = frames[frameId];
00266 
00267             SerializationFlags flags;
00268 
00269             var tes = frame.contactRecords;
00270 
00272 
00273             if (frame.content == FrameContents.Complete)
00274             {
00275                 for (int i = 0, cnt = tes.Count; i < cnt; ++i)
00276                 {
00277                     var te = tes[i];
00278                     
00279                     //Debug.LogError("fid: " + frameId + " Send Pickup " + te.contactSystemViewID + " " + te.contactType + " " + te.contactSystemIndex);
00280 
00282                     buffer.Write(1, ref bitposition, 1);
00283                     buffer.WritePackedBytes((uint)te.contactSystemViewID, ref bitposition, 32);
00284                     // TODO: this requires a proper bitcount, not 8
00285                     buffer.WritePackedBits(te.contactSystemIndex, ref bitposition, 8);
00286 
00287                     // Convert the mask into an index, since only one bit should ever be true.
00288                     var contactType = te.contactType;
00289                     int maskindex = contactType == ContactType.Enter ? 0 : contactType == ContactType.Hitscan ? 3 : contactType == ContactType.Stay ? 1 : 2;
00290                     buffer.Write((uint)maskindex, ref bitposition, 2);
00291                 }
00292                 buffer.Write(0, ref bitposition, 1);
00293                 flags = SerializationFlags.HasContent | SerializationFlags.ForceReliable;
00294             }
00295             else
00296             {
00298                 buffer.WriteBool(false, ref bitposition);
00299                 flags = SerializationFlags.None;
00300             }
00301 
00302             return flags;
00303         }
