00305         public SerializationFlags OnNetDeserialize(int originFrameId, byte[] buffer, ref int bitposition, FrameArrival arrival)
00306         {
00307             Frame frame = frames[originFrameId];
00308 
00309             // Get first content bool to see if we have any contacts at all.
00310             bool hasContent = buffer.ReadBool(ref bitposition);
00311             if (hasContent)
00312             {
00314                 do
00315                 {
00316                     var tes = frame.contactRecords;
00317 
00318                     var te = new ContactRecord(
00319                         (int)buffer.ReadPackedBytes(ref bitposition, 32),
00320                         (byte)buffer.ReadPackedBits(ref bitposition, 8),
00321                         (ContactType)(1 << (int)buffer.Read(ref bitposition, 2))
00322                         );
00323 
00324                     //Debug.LogError(name + " DES: " + te);
00325                     tes.Add(te);
00326 
00327                 }
00328                 // Loop for all contact records.
00329                 while (buffer.ReadBool(ref bitposition));
00330 
00331                 frame.content = FrameContents.Complete;
00332                 return SerializationFlags.HasContent /*| SerializationFlags.ForceReliable*/;
00333             }
00334 
00335             // No contact records
00336             frame.content = FrameContents.Empty;
00337             return SerializationFlags.None;
00338         }
