00342         protected override void ApplySnapshot(Frame snapframe, Frame targframe, bool snapIsValid, bool targIsValid)
00343         {
00344             base.ApplySnapshot(snapframe, targframe, snapIsValid, targIsValid);
00345 
00346             if (snapframe.content == FrameContents.Complete)
00347             {
00348                 List<ContactRecord> contacts = snapframe.contactRecords;
00349 
00350                 for (int i = 0, cnt = contacts.Count; i < cnt; ++i)
00351                 {
00352                     ContactRecord contact = contacts[i];
00353                     var pv = PhotonNetwork.GetPhotonView(contact.contactSystemViewID);
00354 
00355                     if (pv && pv.IsMine)
00356                     {
00357                         var cm = pv.GetComponent<ContactManager>();
00358                         if (cm)
00359                         {
00360                             var currentAttachedICS = cm.GetContacting(contact.contactSystemIndex);
00361 
00362                             // Retry the trigger and see if this will consume it, if so run pickup to apply it.
00363                             var contactevent = new ContactEvent(currentAttachedICS, contactTrigger, contact.contactType);
00364 
00365                             var consumed = Contact(contactevent);
00366                             if (consumed != Consumption.None)
00367                                 Consume(snapframe, contactevent, consumed);
00368                         }
00369                     }
00370                 }
00371             }
00372         }
