00378         // TODO: move this to a utility for use elsewhere
00379         protected static int ConvertMaskToIndex(int mask)
00380         {
00381             int bits = 0;
00382             if (mask > 32767)
00383             {
00384                 mask >>= 16;
00385                 bits += 16;
00386             }
00387 
00388             if (mask > 127)
00389             {
00390                 mask >>= 8;
00391                 bits += 8;
00392             }
00393 
00394             if (mask > 7)
00395             {
00396                 mask >>= 4;
00397                 bits += 4;
00398             }
00399 
00400             if (mask > 1)
00401             {
00402                 mask >>= 2;
00403                 bits += 2;
00404             }
00405 
00406             if (mask > 0)
00407             {
00408                 bits++;
00409             }
00410 
00411             return bits;
00412         }
00413 
00414         public static int ConvertIndexToMask(int index)
00415         {
00416             if (index == 0)
00417                 return 0;
00418 
00419             return 1 << (index - 1);
00420         }
